import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import "./App.css";
import Home from './Containers/Home';
import Signin from './Containers/Signin';
import Signup from './Containers/Signup';
import privateRoute from './Components/Layout/HOC/privateRouterivateRoute'; // Assuming it should be PrivateRoute

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          {/* Use PrivateRoute instead of privateRoute */}
          <privateRoute exact path="/" element={<Home />} />
          <Route exact path="/signin" element={<Signin />} />
          <Route exact path="/signup" element={<Signup />} />
          <Route exact path="/signin/signup" element={<Signup />} />
          <Route exact path="/signup/signin" element={<Signin />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
